BEGIN TRANSACTION;
DROP TABLE IF EXISTS "alembic_version";
CREATE TABLE alembic_version (
	version_num VARCHAR(32) NOT NULL, 
	CONSTRAINT alembic_version_pkc PRIMARY KEY (version_num)
);
DROP TABLE IF EXISTS "application_notes";
CREATE TABLE application_notes (
	id INTEGER NOT NULL, 
	product_family_code VARCHAR(50) NOT NULL, 
	notes TEXT NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (product_family_code)
);
DROP TABLE IF EXISTS "base_models";
CREATE TABLE base_models (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	model_number VARCHAR NOT NULL, 
	description TEXT NOT NULL, 
	base_price FLOAT NOT NULL, 
	base_length FLOAT NOT NULL, 
	voltage VARCHAR NOT NULL, 
	material VARCHAR NOT NULL, insulator_material TEXT, insulator_length FLOAT, insulator_temp_rating TEXT, max_pressure TEXT, housing_type TEXT, housing_ratings TEXT, application_notes TEXT, special_notes TEXT, process_connection_type TEXT, process_connection_size TEXT, process_connection_material TEXT, output_type TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "cable_length_options";
CREATE TABLE cable_length_options (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	length FLOAT NOT NULL, 
	price FLOAT, 
	is_available INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "connection_options";
CREATE TABLE connection_options (
	id INTEGER NOT NULL, 
	type VARCHAR NOT NULL, 
	rating VARCHAR, 
	size VARCHAR NOT NULL, 
	price FLOAT, 
	product_family_id INTEGER NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "customers";
CREATE TABLE customers (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	company VARCHAR, 
	email VARCHAR, 
	phone VARCHAR, 
	address VARCHAR, 
	city VARCHAR, 
	state VARCHAR, 
	zip_code VARCHAR, 
	notes VARCHAR, created_at DATETIME, updated_at DATETIME, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "housing_type_options";
CREATE TABLE housing_type_options (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	housing_type VARCHAR NOT NULL, 
	price FLOAT, 
	is_available INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "length_adder_rules";
CREATE TABLE length_adder_rules (
	id INTEGER NOT NULL, 
	product_family VARCHAR NOT NULL, 
	material_code VARCHAR NOT NULL, 
	adder_type VARCHAR NOT NULL, 
	first_threshold FLOAT NOT NULL, 
	adder_amount FLOAT NOT NULL, 
	description TEXT, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "material_availability";
CREATE TABLE material_availability (
	id INTEGER NOT NULL, 
	material_code VARCHAR NOT NULL, 
	product_type VARCHAR NOT NULL, 
	is_available BOOLEAN, 
	notes TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(material_code) REFERENCES materials (code)
);
DROP TABLE IF EXISTS "material_options";
CREATE TABLE material_options (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	material_code VARCHAR NOT NULL, 
	display_name VARCHAR NOT NULL, 
	base_price FLOAT, 
	is_available INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "materials";
CREATE TABLE materials (
	id INTEGER NOT NULL, 
	code VARCHAR NOT NULL, 
	name VARCHAR NOT NULL, 
	description TEXT, 
	base_length FLOAT NOT NULL, 
	length_adder_per_inch FLOAT, 
	length_adder_per_foot FLOAT, 
	has_nonstandard_length_surcharge BOOLEAN, 
	nonstandard_length_surcharge FLOAT, 
	base_price_adder FLOAT, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "o_ring_material_options";
CREATE TABLE o_ring_material_options (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	material_type VARCHAR NOT NULL, 
	price FLOAT, 
	is_available INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "options";
CREATE TABLE options (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	description TEXT, 
	price FLOAT NOT NULL, 
	price_type VARCHAR, 
	category VARCHAR, 
	excluded_products VARCHAR, 
	product_families VARCHAR, 
	choices JSON, 
	adders JSON, 
	rules JSON, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "product_families";
CREATE TABLE product_families (
	id INTEGER NOT NULL, 
	name VARCHAR NOT NULL, 
	description TEXT, 
	category VARCHAR, 
	base_model_number VARCHAR, 
	base_price FLOAT, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "product_family_options";
CREATE TABLE product_family_options (
	product_family_id INTEGER NOT NULL, 
	option_id INTEGER NOT NULL, 
	is_available INTEGER, 
	family_specific_price FLOAT, 
	notes TEXT, 
	PRIMARY KEY (product_family_id, option_id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id), 
	FOREIGN KEY(option_id) REFERENCES options (id)
);
DROP TABLE IF EXISTS "product_variants";
CREATE TABLE product_variants (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	model_number VARCHAR NOT NULL, 
	description TEXT, 
	base_price FLOAT NOT NULL, 
	base_length FLOAT, 
	voltage VARCHAR, 
	material VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "products";
CREATE TABLE products (
	id INTEGER NOT NULL, 
	model_number VARCHAR NOT NULL, 
	description TEXT, 
	category VARCHAR, 
	base_price FLOAT DEFAULT '0.0' NOT NULL, 
	base_length FLOAT, 
	voltage VARCHAR, 
	material VARCHAR, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "quote_item_options";
CREATE TABLE quote_item_options (
	id INTEGER NOT NULL, 
	quote_item_id INTEGER NOT NULL, 
	option_id INTEGER NOT NULL, 
	quantity INTEGER, 
	price FLOAT NOT NULL, 
	PRIMARY KEY (id), 
	FOREIGN KEY(quote_item_id) REFERENCES quote_items (id), 
	FOREIGN KEY(option_id) REFERENCES options (id)
);
DROP TABLE IF EXISTS "quote_items";
CREATE TABLE quote_items (
	id INTEGER NOT NULL, 
	quote_id INTEGER NOT NULL, 
	product_id INTEGER NOT NULL, 
	quantity INTEGER, 
	unit_price FLOAT NOT NULL, 
	length FLOAT, 
	material VARCHAR, 
	voltage VARCHAR, 
	description TEXT, 
	discount_percent FLOAT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(quote_id) REFERENCES quotes (id), 
	FOREIGN KEY(product_id) REFERENCES product_variants (id)
);
DROP TABLE IF EXISTS "quotes";
CREATE TABLE quotes (
	id INTEGER NOT NULL, 
	quote_number VARCHAR NOT NULL, 
	customer_id INTEGER NOT NULL, 
	date_created DATETIME, 
	expiration_date DATETIME, 
	status VARCHAR, 
	notes TEXT, 
	PRIMARY KEY (id), 
	FOREIGN KEY(customer_id) REFERENCES customers (id)
);
DROP TABLE IF EXISTS "spare_parts";
CREATE TABLE spare_parts (
	id INTEGER NOT NULL, 
	part_number VARCHAR NOT NULL, 
	name VARCHAR NOT NULL, 
	description TEXT, 
	price FLOAT NOT NULL, 
	product_family_id INTEGER, 
	category VARCHAR, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);
DROP TABLE IF EXISTS "standard_lengths";
CREATE TABLE standard_lengths (
	id INTEGER NOT NULL, 
	material_code VARCHAR NOT NULL, 
	length FLOAT NOT NULL, 
	PRIMARY KEY (id)
);
DROP TABLE IF EXISTS "voltage_options";
CREATE TABLE voltage_options (
	id INTEGER NOT NULL, 
	product_family_id INTEGER NOT NULL, 
	voltage VARCHAR NOT NULL, 
	is_available INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(product_family_id) REFERENCES product_families (id)
);

