 (4,4,'LS7000-115VAC-S-10"','LS7000 Level Switch - Base Configuration',715.0,10.0,'115VAC','S','TEF',4.0,'450 F','1500','Cast Aluminum, NEMA 7, D; NEMA 9, E, F, & G','7','1. Cable probes and special materials of construction available.
